@invade_mars Ah bixo, não vou entrar nessa com você.

Se você quer culpar o usuário por um problema pra defender o produto que gosta, vai lá. 

Mas sim, acho que o equipamento é o problema.

@ATeiji Cara, to puto pra caralho sim.

E nem to dando hate não, se fosse pra dar hate eu poderia ficar o dia todo falando de uns problemas menores.

Os relatos são reais.

@CMGiasson @meengole @Lenovo Quando eu falei que meu pc estava lento aqui, recebi 200 mensagens falando que o problema era o windows e deveria ir para o Linux. 

Agora o Linux tem um zilhão de problemas e vem todo mundo "nunca vi isso" "tenho x anos de experiência blabablabla" "o problema é teu pc"

então.

@moisesgobila Notas de repúdio não valem neda enquanto ainda continuam fazendo editoriais que colaboram para as narrativas antidemocraticas do governo.

O problema é esse.

Enquanto jornalistas apanham, eles continuam fazendo o mesmo jogo para agradar a narrativa antidemocratica.

@Andreppepe Calma querido, o texto não é sobre o trabalhador, mas sobre o veículo. 

É absurdo o que está acontecendo com os jornalistas na linha de frente, mas precisamos lembrar que notas de repúdio não são o suficiente para resolver esse problema.

É preciso se posicionar ou vai piorar.
